;; **
;;; What if you iteratively exponentiate that number?
;; **

;; @@
(let [arbitrary-number 7
      exponentiate (partial * arbitrary-number)
      create-multiplication-graph (fn [xs]
                                    (->> xs
                                         (partition 2 1)
                                         (map (fn [[start end]]
                                                [start end arbitrary-number]))
                                         create-graph))
      display-graph (fn [ubergraph]
                      (image-view
                       (ubergraph->png ubergraph {:rankdir :LR})))]
  (->> (iterate exponentiate 1) ;; infinite seq of values of f[n] = arbitrary-number^n
       (take 5)  ;; another arbitrary number; just need to illustrate the exponential nature
       create-multiplication-graph
       my-graph->ubergraph
       display-graph))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"652\" height=\"59\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5542fde \"BufferedImage@5542fde: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@14ab9bef transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 652 height = 59 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Nothing remarkable yet. But what if each integer is now modulo some number?
;; **

;; @@
;; this is easier because it can leverage code I already wrote
(let [arbitrary-number 7
      modulo-base 17
      only-show-multiplying-by-arbitrary-number (fn [graph]
                                                  (filter-edges graph #{arbitrary-number}))
      display-graph (fn [ubergraph]
                      (image-view
                       (ubergraph->png ubergraph {:rankdir :LR})))]
  (->> modulo-base
       group->graph ;; the number modulo-base can represent the entire group it forms;
                    ;; this line then converts that group into a graph
       only-show-multiplying-by-arbitrary-number
       my-graph->ubergraph
       display-graph))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"2203\" height=\"209\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xa574721 \"BufferedImage@a574721: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@14ab9bef transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 2203 height = 209 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; There it is: take an exponential, apply a modulo operation to it, and get a cycle.
;; **

;; **
;;; ## Multiplicative Inverses
;;; Fun fact, in `modulo 17` land, 7 and 5 are multiplcative inverses of each other; in other words, `5Ã—7=1 modulo 17`. Multiplying by 5 modulo 17 is the same as dividing by 7 modulo 17.
;;; 
;;; You can see that in the cycles for 5 and 7: they are the same cycles but reversed.
;; **

;; @@
(let [modulo-base 17
      display-graph (fn [ubergraph]
                      (image-view
                       (ubergraph->png ubergraph {:rankdir :LR})))]
  (display-graph
   (my-graph->ubergraph
    (filter-edges
     (group->graph modulo-base)
     #{5 7}))))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"2203\" height=\"277\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4ef8613b \"BufferedImage@4ef8613b: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@14ab9bef transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 2203 height = 277 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Another fun fact: -7 and -5 (or 10 and 12) are also multiplicative inverses. That makes sense, since the negatives cancel out: `5 Ã— 7 = -5 Ã— -7 = 1 modulo 17`.
;;; 
;;; (Intruiging follow-up question: If the negative signs cancel, why do they not form the same cycles?)
;; **

;; @@
(let [modulo-base 17
      display-graph (fn [ubergraph]
                      (image-view
                       (ubergraph->png ubergraph {:rankdir :LR})))]
  (display-graph
   (my-graph->ubergraph
    (filter-edges
     (group->graph modulo-base)
     #{10 12}))))
